			if(this.$refs.wisdom.classList.contains('fade-in-left')) {
				this.$refs.wisdom.classList.remove('fade-in-left')
			}
			this.$refs.wisdom.classList.add('slide-out-top')
			// this.$refs.wisdom.style.display = "none"
		}
	},
	computed: {
		wisdom() {
			if (this.theme == 'dark') {
				return 'When you hit your lowest point, you are open to the greatest change';
			} else {
				return 'Tranquility is within you'
			}
		}
	},
}
</script>
